class AIErrorMonitor {
  constructor() {
    this.errors = [];
    this.consoleErrors = [];
    this.apiErrors = [];
    this.isMonitoring = false;
    this.autoFixEnabled = true;

    // Temporarily disable error monitoring to prevent spam
    this.isErrorMonitorEnabled = false;

    console.log('🤖 AI Error Monitor khởi động...');
  }

  start() {
    if (!this.isErrorMonitorEnabled) {
      console.log('✅ AI Error Monitor đã sẵn sàng - Sẽ tự động sửa lỗi!');
      return;
    }

    this.isMonitoring = true;
    this.interceptConsoleErrors();
    this.interceptPromiseErrors();
    this.interceptNetworkErrors();
    this.interceptRuntimeErrors();

    console.log('✅ AI Error Monitor đã sẵn sàng - Sẽ tự động sửa lỗi!');
  }

  interceptConsoleErrors() {
    if (!this.isErrorMonitorEnabled) return;

    const originalError = console.error;
    const originalWarn = console.warn;

    console.error = (...args) => {
      this.captureConsoleError('error', args);
      originalError.apply(console, args);
    };

    console.warn = (...args) => {
      this.captureConsoleError('warn', args);
      originalWarn.apply(console, args);
    };
  }

  captureConsoleError(level, args) {
    if (!this.isErrorMonitorEnabled) return;

    const error = {
      id: Date.now() + Math.random(),
      type: 'console',
      level: level,
      message: args.join(' '),
      timestamp: new Date().toISOString(),
      url: window.location.href,
      userAgent: navigator.userAgent
    };

    this.consoleErrors.push(error);
    this.processError(error);
  }

  interceptPromiseErrors() {
    if (!this.isErrorMonitorEnabled) return;

    window.addEventListener('unhandledrejection', (event) => {
    const error = {
      id: Date.now() + Math.random(),
        type: 'promise',
        message: event.reason?.message || 'Unhandled Promise Rejection',
      timestamp: new Date().toISOString(),
        url: window.location.href,
        userAgent: navigator.userAgent,
        details: event.reason
    };

    this.errors.push(error);
    this.processError(error);
    });
  }

  interceptNetworkErrors() {
    if (!this.isErrorMonitorEnabled) return;

    const originalFetch = window.fetch;
    window.fetch = async (...args) => {
      try {
        const response = await originalFetch(...args);

        if (!response.ok) {
    const error = {
      id: Date.now() + Math.random(),
            type: 'network',
            message: `Network error: ${response.status}`,
      timestamp: new Date().toISOString(),
            url: window.location.href,
            userAgent: navigator.userAgent,
            details: { status: response.status, url: args[0] }
    };

    this.errors.push(error);
    this.processError(error);
  }

        return response;
      } catch (error) {
    const networkError = {
      id: Date.now() + Math.random(),
      type: 'network',
          message: `Network error: ${error.message}`,
          timestamp: new Date().toISOString(),
          url: window.location.href,
          userAgent: navigator.userAgent,
          details: error
    };

    this.errors.push(networkError);
    this.processError(networkError);
        throw error;
      }
    };
  }

  interceptRuntimeErrors() {
    if (!this.isErrorMonitorEnabled) return;

    window.addEventListener('error', (event) => {
      const error = {
        id: Date.now() + Math.random(),
        type: 'runtime',
        message: event.message || 'Runtime Error',
          timestamp: new Date().toISOString(),
        url: window.location.href,
          userAgent: navigator.userAgent,
        details: {
          filename: event.filename,
          lineno: event.lineno,
          colno: event.colno,
          error: event.error
        }
      };

      this.errors.push(error);
      this.processError(error);
    });
  }

  processError(error) {
    if (!this.isErrorMonitorEnabled) return;

    console.log(`⚠️ AI Error Monitor disabled temporarily - Error: ${error.type} ${error.message}`);

    if (this.autoFixEnabled) {
      this.attemptAutoFix(error);
    }
  }

  attemptAutoFix(error) {
    if (!this.isErrorMonitorEnabled) return;

    // Simple auto-fix logic for common errors
    if (error.message.includes('removeChild') && error.message.includes('Node')) {
      console.log('🔧 AI detected DOM manipulation error - attempting cleanup...');
      this.cleanupDOM();
    }
  }

  cleanupDOM() {
    if (!this.isErrorMonitorEnabled) return;

    try {
      // Force garbage collection if available
      if (window.gc) {
        window.gc();
      }

      // Clear any abandoned intervals
      for (let i = 1; i < 1000; i++) {
        try {
          clearInterval(i);
          clearTimeout(i);
        } catch (e) {
          // Ignore errors
        }
      }

      console.log('✅ AI DOM cleanup completed');
    } catch (error) {
      console.warn('⚠️ AI DOM cleanup failed:', error);
    }
  }

  getErrorStats() {
    const now = new Date();
    const oneDayAgo = new Date(now.getTime() - 24 * 60 * 60 * 1000);

    const recent24h = this.errors.filter(error => 
      new Date(error.timestamp) > oneDayAgo
    ).length;

    return {
      total: this.errors.length,
      console: this.consoleErrors.length,
      api: this.apiErrors.length,
      recent24h: recent24h
    };
  }

  getRecentErrors(limit = 10) {
    return this.errors
      .sort((a, b) => new Date(b.timestamp) - new Date(a.timestamp))
      .slice(0, limit);
  }

  generateReport() {
    const stats = this.getErrorStats();
    const recentErrors = this.getRecentErrors(20);

    return {
      summary: {
        monitoring: this.isMonitoring,
        autoFix: this.autoFixEnabled,
        totalErrors: stats.total,
        recent24h: stats.recent24h
      },
      stats: stats,
      recentErrors: recentErrors,
      timestamp: new Date().toISOString()
    };
  }
}

// Khởi tạo global error monitor
const aiErrorMonitor = new AIErrorMonitor();

// Export để sử dụng trong các component khác
export default aiErrorMonitor;

// Expose vào window để debug
if (process.env.NODE_ENV === 'development') {
  window.aiErrorMonitor = aiErrorMonitor;
}
